        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](46, "Emanuele Caloisi");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](47, ", nato a Roma classe 1987, Il mio amore per lo sport nasce sin da piccolo avendone praticati dai pi\u00F9 disparati, dal nuoto al calcio passando per il karate, dando sempre dei buoni risultati agonistici. Nel 2001 entrai in una palestra di pugilato rimanendone folgorato, sudore, sacrificio e voglia di mettermi in gioco era ci\u00F2 che mi appassionava e che mi rendeva felice. La mia dedizione verso quello sport cresceva giorno per giorno, dando un senso alla mia iperattivit\u00E0 e tirando fuori il meglio di me stesso! ");
