        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](52, "p", 23);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](53, " In quell\u2019anno bruttissimo, come un\u2019illuminazione, compresi che avrei dovuto far s\u00EC che la mia passione diventasse qualcosa di pi\u00F9, mi iscrissi alla ISSA dove mi diplomai nel 2013 e dopo una costante formazione che dura ancora ad oggi e che non si fermer\u00E0 mai, decisi di licenziarmi da un fantastico posto di lavoro come agente di commercio per una nota multinazionale, con contratto a tempo indeterminato in pi\u00F9 numerosi benefit e buttarmi in una nuova avventura offerta da una grande multinazionale del fitness, la Virgin Active. ");
